import React from "react";

export default function DemoList({ title, items }) {
  const sortedList = items.sort((a, b) => a - b);
  return (
    <div>
      <h2>{title}</h2>
      <ul>
        {sortedList.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </div>
  );
}
